INSERT INTO joke (created_at, joke_id, updated_at, value) VALUES ('2016-05-01 10:51:41.584544', 'etu5stytromsxrgybafqca', '2016-05-01 10:51:41.584544', 'In the X-Men movies, none of the X-Men super-powers are done with special effects. Chuck Norris is the stuntman for every character.');
