INSERT INTO joke (created_at, joke_id, updated_at, value) VALUES ('2016-05-01 10:51:41.584544', 'tnr_ylf0tciqndymlnmw5g', '2016-05-01 10:51:41.584544', 'In the Bible, Jesus turned water into wine. But then Chuck Norris turned that wine into beer.');
INSERT INTO joke (created_at, joke_id, updated_at, value) VALUES ('2016-05-01 10:51:41.584544', 'fw_gwlvrsl-7fxjvezotuq', '2016-05-01 10:51:41.584544', 'Chuck Norris doesn''t believe in ravioli. He stuffs a live turtle with beef and smothers it in pig''s blood.');
