INSERT INTO joke (created_at, joke_id, updated_at, value) VALUES ('2016-05-01 10:51:41.584544', 'rkG_VAn9TGiJXq3glYEX5A', '2016-05-01 10:51:41.584544', 'Chuck Norris CAN see John Cena.');
INSERT INTO joke (created_at, joke_id, updated_at, value) VALUES ('2016-05-01 10:51:41.584544', 'vtdmrqzessabin6ydicnpa', '2016-05-01 10:51:41.584544', 'The show Survivor had the original premise of putting people on an island with Chuck Norris. There were no survivors, and nobody is brave enough to go to the island to retrieve the footage.');
INSERT INTO joke (created_at, joke_id, updated_at, value) VALUES ('2016-05-01 10:51:41.584544', 'gek1crhcq46nslplfvxjpq', '2016-05-01 10:51:41.584544', 'Those aren''t credits that roll after Walker Texas Ranger. It is actually a list of fatalities that occurred during the making of the episode.');
INSERT INTO joke (created_at, joke_id, updated_at, value) VALUES ('2016-05-01 10:51:41.584544', 'dsCZ4chMSNG03LavTv_fGg', '2016-05-01 10:51:41.584544', 'Chuck Norris can watch TV...on his GameBoy...');
INSERT INTO joke (created_at, joke_id, updated_at, value) VALUES ('2016-05-01 10:51:41.584544', 'mbWbKoWNRc24HNXQIt9ubA', '2016-05-01 10:51:41.584544', 'Chuck Norris chooses not to compete in an Ironman because of the swim, every time he starts kicking and swinging his arms, people die!');
