INSERT INTO joke (created_at, joke_id, updated_at, value) VALUES ('2016-05-01 10:51:41.584544', 'ezudm-intc6uvfuzreclpq', '2016-05-01 10:51:41.584544', 'If you spell Chuck Norris in Scrabble, you win. Forever.');
INSERT INTO joke (created_at, joke_id, updated_at, value) VALUES ('2016-05-01 10:51:41.584544', 'j39yav35q4cflrhx6zol_a', '2016-05-01 10:51:41.584544', 'Chuck Norris''s brain waves are suspected to be harmful to cell phones.');
INSERT INTO joke (created_at, joke_id, updated_at, value) VALUES ('2016-05-01 10:51:41.584544', 'y-bNIK9GScaNSMWewihm0w', '2016-05-01 10:51:41.584544', 'Who knows what evil lurks in the hearts of men? Goddamn Chuck Norris, that''s who.');
INSERT INTO joke (created_at, joke_id, updated_at, value) VALUES ('2016-05-01 10:51:41.584544', 'x1w55vtgtc2bglt4q4dd9w', '2016-05-01 10:51:41.584544', 'There is no such thing as global warming. Chuck Norris was cold, so he turned the sun up.');